  input: TEXT,F5N,,"This 24 Hour Report was faxed to the Commission on Friday, October
    15th, because our continued efforts to electronically upload the report to the
    website were unsuccessful.  Tech support has been working with our vendor to finally
    accommodate 24 and 48 hour Form 5 reports by independent expenditure filers, and
    the ongoing efforts were causing an inability to upload this version of the report.  In
    order not to undermine the efforts of the Commission to resolve these filing difficulties,
    no report could be uploaded as of 8:00 p.m. on Friday, October 15, 2004.  We follow-up
    now to fulfill our obligation to file the notice electronically."
